import { View, Text, StyleSheet } from "react-native"

const GoalItem = (props) => {
  return (
    <View style={styles.goalItem}><Text>{props.text}</Text></View>
  )
}
const styles = StyleSheet.create({
  goalItem: {
    padding: 10,
    marginVertical: 5,
    backgroundColor: '#5e0acc',
    color: '#fff',
    borderRadius: 5,
  }
})
export default GoalItem;
